    {
        if iszero(eq(value, and(value, sub(shl(160, 1), 1)))) { revert(0, 0) }
    }
    function validator_revert_bytes4(value)
    {
        if iszero(eq(value, and(value, shl(224, 0xffffffff)))) { revert(0, 0) }
    }
}
